import React from 'react'
import FeatureList from './FeatureList'

const allFeature = [
    {
        key: "1",
        label: "Head Movement",
        children: [
            {
                key: "1a",
                label: "Left",
            },
            {
                key: "1b",
                label: "Right",
            },
            {
                key: "1c",
                label: "Up",
            },
            {
                key: "1d",
                label: "Down",
            }
        ]
    },
    {
        key: "2",
        label: "Facial Expression",
        children: [
            {
                key: "2a",
                label: "Happy",
            },
            {
                key: "2b",
                label: "Sad",
            },
            {
                key: "2c",
                label: "Angry",
            },
            {
                key: "2d",
                label: "Surprise",
            },
            {
                key: "2e",
                label: "Disgust",
            }, 
            {
                key: "2f",
                label: "Neutral",
            }
        ]
    }
]


const Feature = () => {
  return (
    <>
        <div className="row">
            <div className="col text-center">
                <h2>Features</h2>
                <p className="mt-3">
                    <div className="row mt-3 d-flex justify-content-center">
                        <div className="col-lg-8 text-left text-dark">
                            <FeatureList data={allFeature} />  
                        </div>
                    </div>    
                </p>
            </div>
        </div>
    </>
  )
}

export default Feature
